    def dissting(pred_idx, pred, label, gt_box):
        TT = []  # 匹配正确
        TN = []  # 误检
        NT = []  # 漏检
        FLAG = torch.ones_like(gt_box)
        for j in range(pred_idx[0].shape[0]):
            ifin = False
            bbox = pred[pred_idx[0][j], :]
            bbox[0] = int(bbox[0])
            bbox[1] = int(bbox[1])
            bbox[2] = int(bbox[2])
            bbox[3] = int(bbox[3])
            label_name = int(label[pred_idx[0][j]])
            for gt in range(gt_box.shape[0]):
                gt_box[gt][0] = int(gt_box[gt][0])
                gt_box[gt][1] = int(gt_box[gt][1])
                gt_box[gt][2] = int(gt_box[gt][2])
                gt_box[gt][3] = int(gt_box[gt][3])
                label_name_gt = int(gt_box[gt][4])
                IOU = compute_our_iou(bbox, gt_box[gt])
                if IOU > 0.5 and label_name_gt == label_name:
                    ifin = True
                    TT.append(bbox)
                    FLAG[gt][4] = -1
            if not ifin:
                TN.append(bbox)

        for gt in range(gt_box.shape[0]):
            if int(FLAG[gt][4]) != -1:
                NT.append(gt_box[gt])

        return TT, NT, TN

    def compute_our_iou(rec_1, rec_2):
        s_rec1 = (rec_1[2] - rec_1[0]) * (rec_1[3] - rec_1[1])  # 第一个bbox面积 = 长×宽
        s_rec2 = (rec_2[2] - rec_2[0]) * (rec_2[3] - rec_2[1])  # 第二个bbox面积 = 长×宽
        sum_s = s_rec1 + s_rec2  # 总面积
        left = max(rec_1[0], rec_2[0])  # 并集左上角顶点横坐标
        right = min(rec_1[2], rec_2[2])  # 并集右下角顶点横坐标
        bottom = max(rec_1[1], rec_2[1])  # 并集左上角顶点纵坐标
        top = min(rec_1[3], rec_2[3])  # 并集右下角顶点纵坐标
        if left >= right or top <= bottom:  # 不存在并集的情况
            return 0
        else:
            inter = (right - left) * (top - bottom)  # 求并集面积
            iou = (inter / (sum_s - inter)) * 1.0  # 计算IOU
            return iou

